                <style>
                    *,
                    ::after,
                    ::before {
                        margin: 0px;
                        padding: 0px;
                        box-sizing: border-box;
                        font-style: normal;
                        text-rendering: optimizespeed;
                        -webkit-font-smoothing: antialiased;
                        -webkit-tap-highlight-color: transparent;
                        backface-visibility: hidden
                    }

                    button {
                        cursor: pointer;
                        display: flex;
                        justify-content: center;
                        align-items: center;
                        position: relative;
                        border: none;
                        background-color: transparent;
                        transition: all 0.2s ease 0s
                    }

                    @media (hover:hover) and (pointer:fine) {
                        button:active {
                            transition: all 0.1s ease 0s;
                            transform: scale(0.93)
                        }
                    }

                    button::after {
                        content: "";
                        position: absolute;
                        inset: 0px;
                        transition: background-color 0s ease 0s, all 0.2s ease 0s
                    }

                    button:disabled {
                        cursor: not-allowed
                    }

                    button svg,
                    button wcm-text {
                        position: relative;
                        z-index: 1
                    }

                    input {
                        border: none;
                        outline: 0px;
                        appearance: none
                    }

                    img {
                        display: block
                    }

                    ::selection {
                        color: var(--wcm-accent-fill-color);
                        background: var(--wcm-accent-color)
                    }
                </style>
                <style>
                    :host {
                        all: initial
                    }

                    .wcm-overlay {
                        inset: 0px;
                        position: fixed;
                        z-index: var(--wcm-z-index);
                        overflow: hidden;
                        display: flex;
                        justify-content: center;
                        align-items: center;
                        opacity: 0;
                        pointer-events: none;
                        background-color: var(--wcm-overlay-background-color);
                        backdrop-filter: var(--wcm-overlay-backdrop-filter)
                    }

                    @media (max-height:720px) and (orientation:landscape) {
                        .wcm-overlay {
                            overflow: scroll;
                            align-items: flex-start;
                            padding: 20px 0px
                        }
                    }

                    .wcm-active {
                        pointer-events: auto
                    }

                    .wcm-container {
                        position: relative;
                        max-width: 360px;
                        width: 100%;
                        outline: 0px;
                        border-radius: var(--wcm-background-border-radius) var(--wcm-background-border-radius) var(--wcm-container-border-radius) var(--wcm-container-border-radius);
                        border: 1px solid var(--wcm-color-overlay);
                        overflow: hidden
                    }

                    .wcm-card {
                        width: 100%;
                        position: relative;
                        border-radius: var(--wcm-container-border-radius);
                        overflow: hidden;
                        box-shadow: 0 6px 14px -6px rgba(10, 16, 31, .12), 0 10px 32px -4px rgba(10, 16, 31, .1), 0 0 0 1px var(--wcm-color-overlay);
                        background-color: var(--wcm-color-bg-1);
                        color: var(--wcm-color-fg-1)
                    }

                    @media (max-width:600px) {
                        .wcm-container {
                            max-width: 440px;
                            border-radius: var(--wcm-background-border-radius) var(--wcm-background-border-radius)0 0
                        }

                        .wcm-card {
                            border-radius: var(--wcm-container-border-radius) var(--wcm-container-border-radius)0 0
                        }

                        .wcm-overlay {
                            align-items: flex-end
                        }
                    }

                    @media (max-width:440px) {
                        .wcm-container {
                            border: 0px
                        }
                    }
                </style><wcm-explorer-context><template
                        shadowrootmode=open></template></wcm-explorer-context><wcm-theme-context><template
                        shadowrootmode=open></template></wcm-theme-context>
                <div id=wcm-modal role=alertdialog aria-modal=true class=wcm-overlay>
                    <div class=wcm-container tabindex=0></div>
                </div></template></wcm-modal>

                <script
                    data-template-shadow-root>(() => { document.currentScript.remove(); processNode(document); function processNode(node) { node.querySelectorAll("template[shadowrootmode]").forEach(element => { let shadowRoot = element.parentElement.shadowRoot; if (!shadowRoot) { try { shadowRoot = element.parentElement.attachShadow({ mode: element.getAttribute("shadowrootmode") }); shadowRoot.innerHTML = element.innerHTML; element.remove() } catch (error) { } if (shadowRoot) { processNode(shadowRoot) } } }) } })()</script>

</body>
